MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Layout comparison tools include FastXOR, DBdiff, and standard XOR with Calibre nmDRC. The fdi2gds and fdi2oasis tools translate LEF/DEF and OpenAccess (OA) databases to GDS or OASISOASIS is a registered Trademark of Thomas Grebinski and licensed for use to SEMI, San Jose, California.. The fdiBA utility backannotates fill and via enhancements to a LEF/DEF or OA database.");
MGCAddSnippet(6, "Layout Versus Layout (LVL) comparison comprises three fundamental flows: FastXOR, the standard dual-database flow, and DBdiff.");
MGCAddSnippet(7, "Calibre has two command line utilities that translate third-party databases to either GDSII or OASIS format. The utilities are called fdi2gds and fdi2oasis. The acronym FDI stands for Foreign Database Interface. ");
MGCAddSnippet(8, "Calibre includes direct DEF output capabilities in addition to a stand-alone utility to backannotate Calibre enhancements, vias, and fill to third-party databases. ");
MGCAddSnippet(9, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(10, "A major application of the Calibre dual-database capability is layout-versus-layout (LVL), or dual-database comparison. ");
MGCAddSnippet(11, "Use Calibre nmDRC-H for performing LVL comparison. ");
MGCAddSnippet(12, "For a dual-database model to have meaningful applications, primitive objects (shapes and text) must be distinguishable between the two databases. The problem that arises is when identical layer numbers are used in both databases.");
MGCAddSnippet(13, "For flat dual-database applications, the layer bump value from the Layout Bump2 specification statement controls all semantics for combining the two input layout databases. The internal combination process is more complicated in hierarchical applications because they preserve the input hierarchy instead of flattening it. ");
MGCAddSnippet(14, "Calibre FastXOR uses the DBdiff utility to decrease Layout Versus Layout (LVL) XOR comparison run times. FastXOR often runs five times faster than a normal dual-database XOR run.");
MGCAddSnippet(15, "You can run FastXOR from the command-line or from the Calibre Interactive nmDRC GUI.");
MGCAddSnippet(16, "FastXOR performs layout comparison as a two stage process. The first stage uses the DBdiff utility to perform cell-by-cell object comparison in order to exclude any unchanged data from further processing. DBdiff then submits data that has been changed to the second stage. In the second stage, Calibre nmDRC-H performs an XOR comparison of the layers that have differences. ");
MGCAddSnippet(17, "There are several functional differences between FastXOR, DBdiff, and standard XOR layout comparison.");
MGCAddSnippet(18, "Produce an LVL rule file using DBdiff. The rule file employs XOR rule checks to find differences between two designs. The layers used in the layouts are assumed to correspond by number.");
MGCAddSnippet(19, "Use FastXOR to compare two layouts.");
MGCAddSnippet(20, "Compare FastXOR (calibre -fx) and traditional Calibre nmDRC-H LVL runs on the same two layouts when using similar runtime environments for the two runs. ");
MGCAddSnippet(21, "In some cases, the default FastXOR configuration may not be optimal for your environment or layout databases. There are several options you can define that can have a significant impact on performance.");
MGCAddSnippet(22, "FastXOR is triggered by the calibre -fx command-line option.");
MGCAddSnippet(23, "You can generate rules for LVL comparison by using the DBdiff -write_xor_rules option. The rules generated by this command are recommended for all LVL XOR runs. ");
MGCAddSnippet(24, "The FastXOR rule file that is written using the DBdiff ‑write_xor_rules option maps layers for comparison based upon corresponding numbers. Layers that have the same numbers in both databases, respectively, are compared in the rule file that gets written.");
MGCAddSnippet(25, "The DBdiff -layermap file is used for customized layer mapping for comparing layers on differing layer numbers, datatypes, and so forth. The -layermap option can be specified when writing the rules with the dbdiff ‑write_xor_rules option, or it can be specified with the CALIBRE_FX_DB_DIFF_OPTIONS environment variable. In the latter case, it applies during the FastXOR run and the rules are expected to handle the layers after mapping.");
MGCAddSnippet(26, "You can use an optional column in a layer mapping file that specifies a CURrent or REFerence keyword. Using these keywords creates a correspondence between disparate layers in two databases. These two keywords can be abbreviated with their first three letters. ");
MGCAddSnippet(27, "You can use an optional column in the layer mapping file that specifies a WINDEL_LAYER or WINDOW_LAYER keyword. The keywords provide a way to exclude or include areas covered by specific layers in a design. ");
MGCAddSnippet(28, "FastXOR rule files may have the Exclude Cell specification statement in them. When Exclude Cell statements are present in the rule file, the same semantics for a typical Calibre nmDRC run apply to the DBdiff portion of a FastXOR run. Such statements can appear in the FastXOR rule file when the DBdiff -include_rules option is used.");
MGCAddSnippet(29, "Boolean NOT operations are supported in FastXOR with certain restrictions.");
MGCAddSnippet(30, "FastXOR outputs run-specific entries to the transcript that are useful for debugging.");
MGCAddSnippet(31, "During a FastXOR run, DBdiff is automatically called as an initial processing step to analyze the layouts for differences. It is unnecessary to call DBdiff explicitly.");
MGCAddSnippet(32, "You should consider running FastXOR, traditional XOR, and doing a comparison of the two runs in three separate directories. ");
MGCAddSnippet(33, "You must understand the limitations of FastXOR before you perform database comparison.");
MGCAddSnippet(34, "This section discusses some of the problems you may encounter when doing LVL comparisons using FastXOR. ");
MGCAddSnippet(35, "If you are comparing third-party databases, such as LEF/DEF and OpenAccess you may encounter situations where all items are not compared.");
MGCAddSnippet(36, "Troubleshoot layers that are not compared.");
MGCAddSnippet(37, "Troubleshoot undesired layers that are compared.");
MGCAddSnippet(38, "Troubleshoot mismatches between FastXOR and standard XOR.");
MGCAddSnippet(39, "Troubleshoot differences between DBdiff and FastXOR runs.");
MGCAddSnippet(40, "Troubleshoot differences in input exception handling between DBdiff and Calibre nmDRC.");
MGCAddSnippet(41, "Troubleshoot differences in incorrect comparison results due to non-orthogonal shapes.");
MGCAddSnippet(42, "Troubleshoot problems in OA database comparisons.");
MGCAddSnippet(43, "Troubleshoot problems in LEF/DEF database comparisons.");
MGCAddSnippet(44, "FastXOR uses several environment variables to control the tool flow.");
MGCAddSnippet(45, "DBdiff enables you to compare two design databases and isolate differences between each one. ");
MGCAddSnippet(46, "DBdiff provides a summary of differences between two layout databases. Differences are written to a report file and an optional Calibre results database. The application can also generate XOR rules for use with standard XOR or FastXOR.");
MGCAddSnippet(47, "DBdiff accepts GDS and OASIS databases in addition to the supported third-party layout databases.");
MGCAddSnippet(48, "Use DBdiff to perform fast Layout versus Layout comparisons. DBdiff performs a fast cell-by-cell comparison of shapes, instances, properties (if enabled), and text between two layouts. ");
MGCAddSnippet(49, "DBdiff generates a summary of differences in a text report and a Calibre RVE results database when you apply the ‑report and ‑rdb options, respectively.");
MGCAddSnippet(50, "The DBdiff invocation syntax depends on the type of library and the information that you want to report.");
MGCAddSnippet(51, "The DBdiff application compares databases of different types. This section covers the syntax and arguments for DBdiff.");
MGCAddSnippet(52, "The -write_xor_rules DBdiff command syntax is used for automatic generation of XOR rules.");
MGCAddSnippet(53, "The ASCII report file shows differences between the compared layouts. Shape, Instance, and Text difference tables are generated, depending on the differences found. ");
MGCAddSnippet(54, "There are some OASIS format restrictions you must consider before running DBdiff. ");
MGCAddSnippet(55, "It is highly recommended to use fdi2gds or fdi2oasis to translate your LEF/DEF design before running any comparison. These utilities provide finer control over how your data is translated and will give you a better understanding of what objects are available for comparison.");
MGCAddSnippet(56, "If comparing OpenAccess to OpenAccess and the layer schemes differ, or if comparing OpenAccess to GDS or OASIS, then a DBdiff layer mapping file is needed. ");
MGCAddSnippet(57, "The fdi2gds and fdi2oasis utilities translate third-party format design databases into GDSII or OASIS formats.");
MGCAddSnippet(58, "The fdi2gds, fdi2oasis, and fdiBA utilities support LEF/DEF and OpenAccess third-party databases.");
MGCAddSnippet(59, "The FDI utilities check for the presence of licenses only; they do not check out a license.");
MGCAddSnippet(60, "Calibre uses shell environment variables to configure third-party database tools and options.");
MGCAddSnippet(61, "GDS to Layout translation is handled by the gds2oasis application.");
MGCAddSnippet(62, "The fdi2gds and fdi2oasis utilities required minimal input to generate GDS or OASIS outputs, but there are a number of options that allow you to customize the output to suit your flow.");
MGCAddSnippet(63, "It is important to understand and control how layers in a LEF/DEF database are mapped to OASIS and GDS. You can automatically generate a template mapping file and then modify that file to suit your needs.");
MGCAddSnippet(64, "This example translates a LEF/DEF design to GDS. The procedure for OASIS is the same, except that you apply the fdi2oasis command. ");
MGCAddSnippet(65, "DEF files are not required when translating LEF macro libraries to GDS or OASIS. Outputting the layout on standard out can also be useful for passing data between flows in a single command.");
MGCAddSnippet(66, "The fdi2gds and fdi2oasis utilities allow you to map properties from LEF/DEF designs to properties or text in the output GDS or OASIS files.");
MGCAddSnippet(67, "The following example shows how to translate an OpenAccess (OA) design to OASIS. The procedure is the same for GDS output.");
MGCAddSnippet(68, "After performing a LEF/DEF database translation using fdi2gds or fdi2oasis, the tool outputs tables to the transcript that summarize information from the run and the input files that were read.");
MGCAddSnippet(69, "The usage and options for fdi2gds and fdi2oasis differ depending on the input layout database.");
MGCAddSnippet(70, "The fdi2gds or fdi2oasis command line utilities are used to translate LEF/DEF input files.");
MGCAddSnippet(71, "The fdi2gds or fdi2oasis command line utilities are used to translate OpenAccess input files.");
MGCAddSnippet(72, "The FDI utilities reside in the Calibre installation tree s bin directory. ");
MGCAddSnippet(73, "The FDI utilities accept several input files that control aspects of the flow that are specific to the design and environment, such as the layer mapping and object properties.");
MGCAddSnippet(74, "fdi2gds and fdi2oasis use a different mapping format when translating LEF/DEF databases. ");
MGCAddSnippet(75, "Specifies how layers and objects in a LEF/DEF input design database are translated to the GDS or OASIS output database layers for fdi2gds and fdi2oasis. ");
MGCAddSnippet(76, "Alternate syntax for the LEF/DEF map file that specifies how text labels in a LEF/DEF input design database are translated to the GDS or OASIS output database layers for fdi2gds and fdi2oasis. ");
MGCAddSnippet(77, "The automatically generated map file (created when translating LEF/DEF systems without the ‑map option) contains separate mapping statements for each row object in the DEF.");
MGCAddSnippet(78, "The fdi2gds and fdi2oasis utilities output a default map file for LEF/DEF if you do not specify ‑map.");
MGCAddSnippet(79, "OpenAccess databases use a different set of mapping options and files than LEF/DEF systems in fdi2gds and fdi2oasis");
MGCAddSnippet(80, "The place and route mapping format is used for OpenAccess databases. The columns refer to the layer name, purpose name, layer number, and datatype number. ");
MGCAddSnippet(81, "Specifies how layers in an OpenAccess or LEF design database correspond to the GDS or OASIS output database layers for fdi2gds and fdi2oasis. The file specified by this option conforms to an industry-standard Cadence OA layer map file format.");
MGCAddSnippet(82, "Specifies how layers in the input design database correspond to the GDS or OASIS output database layers for fdi2gds and fdi2oasis. ");
MGCAddSnippet(83, "Specifies how blockage objects are mapped to the output. Blockage objects that are not listed in this file are not output. ");
MGCAddSnippet(84, "Maps cell names in the input design library to cells in the output GDS or OASIS library.");
MGCAddSnippet(85, "Used to view SVRF layer mapping generated by fdi2gds and fdi2oasis. ");
MGCAddSnippet(86, "This output file shows what mappings the FDI translators applied, including any user-specified mappings. ");
MGCAddSnippet(87, "Specifies net names and their corresponding net type properties. ");
MGCAddSnippet(88, "Contains a list of net names and net types to be annotated in the output.");
MGCAddSnippet(89, "Maps the input database properties to output properties. The contents of the property mapping file are system-dependent. By default, if you do not specify a mapping file, input database properties are not output. ");
MGCAddSnippet(90, "Specifies input exceptions.");
MGCAddSnippet(91, "Specifies a list of command line arguments to be passed to fdi2gds or fdi2oasis. If you specify a template file, arguments specified on the command line have precedence over arguments specified in the template file.");
MGCAddSnippet(92, "The fdiBA utility performs backannotation of fill data or vias stored in a specified input database. ");
MGCAddSnippet(93, "The Calibre DEF backannotation flow enables you to generate geometries (such as redundant vias, line extensions, and fill) for a LEF/DEF layout in Calibre and then export the new geometries to a full or incremental DEF file. You can read the generated DEF file into your place and route tool using to combine the enhanced geometries with your existing design.");
MGCAddSnippet(94, "The fdiBA utility, when used with the fdi2gds and fdi2oasis utilities, can provide a closed loop flow between Calibre layout enhancements and third-party design development.");
MGCAddSnippet(95, "This procedure demonstrates how to use the fdiBA utility to backannotate fill objects to DEF. ");
MGCAddSnippet(96, "You can use fdiBA to backannotate DFM shapes that require net names to your DEF layout.");
MGCAddSnippet(97, "The fdiBA utility backannotates to LEF/DEF or OpenAccess third-party databases.");
MGCAddSnippet(98, "The fdiBA tool resides in the Calibre tree s bin directory.");
MGCAddSnippet(99, "The fdiBA utility uses its own layer mapping file.");
MGCAddSnippet(100, "Specifies the layer correspondence between the fill data and the third-party layout database for fdiBA.");
MGCAddSnippet(101, "Maps layers for the backannotation fill input file in DFM database format.");
MGCAddSnippet(102, "Error and warning messages are issued by the fdi2gds, fdi2oasis, fdiBA, DBdiff, FastXOR, and Calibre View utilities at runtime.");
MGCAddSnippet(103, "This section describes messages issued by fdi2gds, fdi2oasis, fdiBA, and Calibre View.");
MGCAddSnippet(104, "Use these error and warning summary tables to debug errors in DBdiff.");
MGCAddSnippet(105, "Use these error and warning message descriptions to debug issues during a run.");
MGCAddSnippet(106, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

